import React from 'react';
import { Box, Typography, List, ListItem, ListItemIcon, ListItemText, Button, Divider } from '@mui/material';
import { useNavigate, useLocation } from 'react-router-dom';
import DashboardIcon from '@mui/icons-material/Dashboard';
import EventIcon from '@mui/icons-material/Event';
import PeopleIcon from '@mui/icons-material/People';
import CalendarMonthIcon from '@mui/icons-material/CalendarMonth';
import NotificationsActiveIcon from '@mui/icons-material/NotificationsActive';
import SettingsIcon from '@mui/icons-material/Settings';
import SvgIcon from '@mui/material/SvgIcon';
import { useTheme } from '@mui/material/styles';
import './Sidebar.css';

// Custom EA logo icon component
const EALogoIcon = (props) => {
  return (
    <SvgIcon {...props} viewBox="0 0 24 24">
      <path 
        d="M12 2L4 6v12l8 4 8-4V6L12 2zm0 2.5L18 8v8l-6 3-6-3V8l6-3.5zm1 1.5h-2v6h2V6zm0 8h-2v2h2v-2z"
        fill="currentColor"
      />
    </SvgIcon>
  );
};

const Sidebar = () => {
  const navigate = useNavigate();
  const location = useLocation();
  const theme = useTheme();

  const menuItems = [
    { 
      text: 'Dashboard', 
      icon: <DashboardIcon />, 
      path: '/dashboard',
      onClick: () => navigate('/dashboard')
    },
    { 
      text: 'My Events', 
      icon: <EventIcon />, 
      path: '/events',
      onClick: () => navigate('/events') 
    },
    { 
      text: 'Calendar', 
      icon: <CalendarMonthIcon />, 
      path: '/calendar',
      onClick: () => navigate('/calendar')
    },
    { 
      text: 'Attendees', 
      icon: <PeopleIcon />, 
      path: '/attendees',
      onClick: () => navigate('/attendees')
    },
    { 
      text: 'Notifications', 
      icon: <NotificationsActiveIcon />, 
      path: '/notifications',
      onClick: () => navigate('/notifications')
    },
    { 
      text: 'Settings', 
      icon: <SettingsIcon />, 
      path: '/settings',
      onClick: () => navigate('/settings')
    }
  ];

  return (
    <Box className="sidebar">
      <Box className="sidebar-header">
        <Box sx={{ display: 'flex', alignItems: 'center' }}>
          <div className="sidebar-logo">
            <EALogoIcon sx={{ fontSize: 28, color: theme.palette.background.default }} />
          </div>
          <Typography 
            variant="h6" 
            className="app-title"
            sx={{ ml: 1.5, color: theme.palette.background.default, fontWeight: 600 }}
          >
            EventAlly
          </Typography>
        </Box>
      </Box>

      <Divider className="sidebar-divider" />

      <List component="nav" className="sidebar-nav">
        {menuItems.map((item) => (
          <ListItem 
            button 
            key={item.text} 
            onClick={item.onClick}
            className={location.pathname === item.path ? "sidebar-item-active" : "sidebar-item"}
          >
            <ListItemIcon className="sidebar-icon">
              {item.icon}
            </ListItemIcon>
            <ListItemText primary={item.text} />
          </ListItem>
        ))}
      </List>

      <Box className="sidebar-footer">
        <Button 
          variant="contained" 
          color="primary" 
          fullWidth 
          startIcon={<EventIcon />}
          onClick={() => navigate('/create-event')}
          className="create-event-button"
          sx={{ 
            textTransform: 'none', 
            fontWeight: 600,
            borderRadius: '50px',
            boxShadow: 'none',
            py: 1
          }}
        >
          Create Event
        </Button>

        <Box sx={{ mt: 4, px: 2, textAlign: 'center' }}>
          <Typography variant="body2" className="sidebar-footer-text" sx={{ opacity: 0.9, mb: 0.5 }}>
            Event Management Made Simple
          </Typography>
          <Typography variant="caption" className="sidebar-footer-text" sx={{ opacity: 0.7 }}>
            Create, manage, and track events with our platform
          </Typography>
        </Box>
      </Box>
    </Box>
  );
};

export default Sidebar;
